class FirstProgram{

def log
def context
def testRunner


def sayHello(){
	log.info("Say Hello")
}

def sayHelloName(String name){
	log.info("Say Hello" + name)
}
// define a constructor for this class and instantiate the variables..

def FirstProgram(log, context, testRunner){

	this.log = log
	this.context = context
	this.testRunner = testRunner
}

}

context.setProperty("FirstProgram", new FirstProgram(log,context,testRunner))
// this statement will help to instantiate the class

def testStep = testRunner.testCase.getTestStepByName("Groovy Script 2")

testStep.run(testRunner,context)
// get the access to the methods with in class called "FirstProgram"
context.FirstProgram

context.FirstProgram.sayHello()
context.FirstProgram.sayHelloName("Smith")

project = testRunner.testCase.testSuite.project;

tCase = project.testSuites["SingleTestSuite"].testCases["CountryInfoServiceSoapBinding TestSuite"]
FirstProgram = tCase.getTestStepByName("Groovy Script 2")

//def testStep = testRunner.testCase.getTestStepByName("Groovy Script 2")

FirstProgram.run(testRunner,context)
// get the access to the methods with in class called "FirstProgram"
context.FirstProgram

context.FirstProgram.sayHello()
context.FirstProgram.sayHelloName("Smith")

project = testRunner.testCase.testSuite.project;
tCase = project.testSuites["SingleTestSuite"].testCases["TestCase 3"]
tStep = tCase.getTestStepByName("GetCountryISOCode")


def status = tStep.run(testRunner,context)
def results = status.getStatus().toString()
log.info (">>>" +results)

def status = testRunner.runTestStepByName("GetCountryISOCode")
log.info(" >>> " + status)

def results = status.getStatus().toString()
log.info (" >>> " + results)


if(results== "OK"){
	log.info ("   Test Passed")
}else {
	log.info ("  Test Failed")
}

def tCase = testRunner.testCase.testSuite.testCases["TestCase 3"]


def runner = tCase.run(null,false)
def results = runner.getStatus().toString()
log.info(results)


// get all the TC's suite..

def testCases = context.testCase.testSuite.getTestCaseList()
testCases.each{
	log.info  (it.name)

	if(it.name == "TestCase 3"){
		log.info("This is TC 3")
	}
}

def projectName = testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1")
def status = projectName.run(null,true)
Thread.sleep(6000)

def results = status.getStatus().toString()
